{'text': 'Two Carnegie Mellon alumni, including a #cmuece grad, contributed to ensuring a smooth Inauguration Day. General Bowie (ECE 1989) was the first to salute President Joe Biden and Vice President Kamala Harris. 

For Bowie, a West Baltimore native and 1989 graduate of CMU‚Äôs College of Engineering, January 20, 2021, was his fourth time playing a leadership role in a presidential inauguration. This year, as Deputy Commanding General ‚Äî Inauguration, Bowie was tasked with organizing all the military logistics of the ceremony on that day.

